import React from "react";
import Menu from './Menu';

const Header = ({title}) => (<header>{title}</header>);
const Main = ({title}) => (<main>{title}</main>);
const Footer = ({title}) => (<footer>{title}</footer>);

const MainFront = () => {

    return (
      <div>
        <Header title="야티구" />
        <Menu/>
        <Footer title="footer"/>
      </div>
  )
};
export default MainFront;
